import React from 'react';
import ReactDOM from 'react-dom';

const Table = () => {
    return (
        <table>
            <tr>
                <th>Firstname</th>
                <th>Lastname</th>
                <th>Age</th>
            </tr>
            <tr>
                <td>Jill</td>
                <td>Smith</td>
                <td>50</td>
            </tr>
            <tr>
                <td>Eve</td>
                <td>Jackson</td>
                <td>94</td>
            </tr>
        </table>
    );
};

const TableHeader = () => {
    return (
        <h1>My Table</h1>
    );
};
const el = (
    <div>
        <TableHeader />
        <Table />
    </div>
);
ReactDOM.render(el, document.getElementById('root'));
